<p>dan kalau di jalankan hasilnya akan seperti ini</p>

<pre>
<code>07-05-2022 01:59
1651878717</code></pre>

<p>karena kedua variabel tersebut formatnya berbeda maka variable $waktu_posting harus kita ubah dulu ke format time caranya kita menggunakan fungsi</p>

<pre>
<code class="language-php">strtotime()</code></pre>

<p>&nbsp;</p>

<p>jadi hasinya seperti ini</p>

<pre>
<code class="language-php">&lt;?php 
	date_default_timezone_set('Asia/Jakarta');
	$waktu_posting = "07-05-2022 01:59";

	$waktu_sekarang = time();

	echo strtotime($waktu_posting);
	echo "&lt;br&gt;";
	echo $waktu_sekarang;
 ?&gt;</code></pre>

<p>dan hasil setelah di jalankan</p>

<pre>
<code>1651863540
1651878900</code></pre>

<p>&nbsp;</p>

<p>nah sekarang karena format nya sudah sama</p>

<p>selanjutnya kita akan membuat fitur utamanya</p>

<p>kita cukup mengambil selisih angka tersebut</p>

<pre>
<code>$selisih = $waktu_sekarang - strtotime($waktu_posting);</code></pre>

<p>hasil dari $selisih adalah jumlah berapa detik perbedaan atau jarak dari kedua variable tersebut</p>

<p>&nbsp;</p>

<p>hasilnya</p>

<pre>
<code>15524</code></pre>

<p>berarti ada 15.524 detik yang lalu</p>

<p>&nbsp;</p>

<p>sekarang kita akan membuat fungsinya</p>

<pre>
<code class="language-php">&lt;?php 
	date_default_timezone_set('Asia/Jakarta');
	$waktu_posting = "07-05-2022 05:37";

	$waktu_sekarang = time();

	$selisih = $waktu_sekarang - strtotime($waktu_posting);


	if ($selisih &lt; 60) {
		echo round($selisih)." detik yang lalu";
	}elseif($selisih &lt; (60*60)){
		echo round(($selisih/60))." menit yang lalu";

	}elseif($selisih &lt; (60*60*24)){
		echo round(($selisih/(60*60)))." jam yang lalu";

	}elseif($selisih &lt; (60*60*24*3)){
		echo round(($selisih/(60*60*24)))." hari yang lalu";

	}else{
		echo "sudah lebih 3 hari";
	}
 ?&gt;</code></pre>

<p>&nbsp;</p>

<p>fungsi round() adalah untuk membulatkan sebuah angka jadi biar gak ada koma koma nya</p>

<pre>
<code>round()</code></pre>

<p>&nbsp;</p>

<p>penjelasan</p>

<pre>
<code class="language-php">if ($selisih &lt; 60) {
		echo round($selisih)." detik yang lalu";</code></pre>

<p>di bagian kode ini kita akan mengecek apakah selisihnya itu kurang dari 60 detik berartikan selisihnya masih perdetik masih hangat ya kan</p>

<p>kemudian di else if&nbsp;</p>

<pre>
<code class="language-php">}elseif($selisih &lt; (60*60)){
		echo round(($selisih/60))." menit yang lalu";</code></pre>

<p>dibagian ini kita akan mengalikan karena 1 menit ada 60 detik maka kita kalikan saja dan seterusnya</p>

<p>&nbsp;</p>

<p>sampai di baris ini</p>

<pre>
<code class="language-php">elseif($selisih &lt; (60*60*24*3)){
		echo round(($selisih/(60*60*24)))." hari yang lalu";</code></pre>

<p>60*60*24*3 itu artinya 60 detik x 60 menit x 24 jam x 3 hari</p>

<p>berarti kode ini apabila belum mencapai 3 hari maka akan di kategorikan termasuk beberapa hari yang lalu</p>

<p>&nbsp;</p>

<p>&nbsp;</p>

<p>mungkin sekian penjelasan bagimana cara membuat fitur beberapa menit yang lalu di php

