 pada hari XHARIX ini mimin akan berbagi tutorial yaitu cara menghitung umur dari pemograman php</p>

<p>oke langsung saja kita mulai</p>

<p>&nbsp;</p>

<h2><strong>cara menghitung umur dari pemograman php</strong></h2>

<p>&nbsp;</p>

<p>pertama kita buat form sederhana menggunakan html</p>

<pre>
<code class="language-html">&lt;form action="" method="post"&gt;
	&lt;input type="date" name="tanggal_lahir" max="2001-09-01"&gt;&lt;br&gt;
	&lt;button type="submit"&gt;CEK UMUR&lt;/button&gt;
&lt;/form&gt;</code></pre>

<p>kemudian kita siapkan script phpnya untuk menghitung umur dari input tanggal yang kita masukkan</p>

<p>&nbsp;</p>

<pre>
<code class="language-php">&lt;?php 
	if (isset($_POST['tanggal_lahir'])) {
		$tgl = $_POST['tanggal_lahir'];
		$tanggal = new DateTime($tgl);
		$today = new DateTime('today');
		$tahun = $today-&gt;diff($tanggal)-&gt;y;
		$bulan = $today-&gt;diff($tanggal)-&gt;m;
		$hari = $today-&gt;diff($tanggal)-&gt;d;
		echo "Umur: " . $tahun . " tahun " . $bulan . " bulan " . $hari . " hari";
		echo "&lt;hr&gt;";
	}

 ?&gt;</code></pre>

<p>dan hasilnya seperi ini</p>

<pre>
<code class="language-html">Umur: 20 tahun 8 bulan 7 hari</code></pre>

<p>&nbsp;</p>

<p>kamu bisa mengganti nilai max nya untuk batas tahun di form htmlnya</p>

<pre>
<code>max="2001-09-01"</code></pre>

