 pada hari XHARIX ini mimin akan berbagi tutorial yaitu cara mengetahui alamat ip user dan browser yang di gunakan</p>

<p>&nbsp;</p>

<h2><strong>cara mengetahui alamat ip user dan browser yang di gunakan</strong></h2>

<h3><strong>Apa itu alamat ip ?</strong></h3>

<p>alamat ip itu ibarat alamat dari suatu komputer atau perangkat</p>

<p>biasanya panjang angkanya adalah dari 0.0.0.0 sampai 255.255.255.255.</p>

<p>&nbsp;</p>

<h3><strong>Apa itu browser ?</strong></h3>

<p>kemudian browser adalah aplikasi yang di gunakan si user suntuk membuka sebuah website</p>

<p>browser ada banyak salah satunya ada chrome yang populer</p>

<p>&nbsp;</p>

<p>&nbsp;</p>

<h2><strong>Cara mendapatkan alamat ip user dengan php</strong></h2>

<pre>
<code class="language-php">function get_client_ip() {
    $ipaddress = '';
    if (isset($_SERVER['HTTP_CLIENT_IP']))
        $ipaddress = $_SERVER['HTTP_CLIENT_IP'];
    else if(isset($_SERVER['HTTP_X_FORWARDED_FOR']))
        $ipaddress = $_SERVER['HTTP_X_FORWARDED_FOR'];
    else if(isset($_SERVER['HTTP_X_FORWARDED']))
        $ipaddress = $_SERVER['HTTP_X_FORWARDED'];
    else if(isset($_SERVER['HTTP_FORWARDED_FOR']))
        $ipaddress = $_SERVER['HTTP_FORWARDED_FOR'];
    else if(isset($_SERVER['HTTP_FORWARDED']))
        $ipaddress = $_SERVER['HTTP_FORWARDED'];
    else if(isset($_SERVER['REMOTE_ADDR']))
        $ipaddress = $_SERVER['REMOTE_ADDR'];
    else
        $ipaddress = 'IP tidak dikenali';
    return $ipaddress;
}</code></pre>

<p>cara menggunakannya hanya panggil saja functionnya</p>

<pre>
<code class="language-php">get_client_ip()</code></pre>

